import React from 'react';
import {
    MDBCarousel,
    MDBCarouselInner,
    MDBCarouselItem,
    MDBCarouselElement,
    MDBCarouselCaption,
    
  } from 'mdb-react-ui-kit';
  import { MDBBtn, MDBIcon } from 'mdb-react-ui-kit';
  import projects from '../../projects.json'



function Projects() {
    return (
      <>
       


            <MDBCarousel showIndicators showControls fade>
                <MDBCarouselInner>
                {projects.map((project) => (
                    <MDBCarouselItem className='active'>
                   

                        <MDBCarouselElement src={project.image} alt='...' />
                        <MDBCarouselCaption>
                            <h5>{project.name}</h5>
                                <MDBBtn className='m-1' style={{ backgroundColor: '#333333' }} href={project.github}>
                                    <MDBIcon fab icon='github' />
                                </MDBBtn>
                                <MDBBtn className='m-1' style={{ backgroundColor: '#0082ca' }} href={project.online}>
                                    <MDBIcon fab icon='dribbble' />
                                </MDBBtn>
                        </MDBCarouselCaption>
                    </MDBCarouselItem>
                    ))}
                </MDBCarouselInner>
                </MDBCarousel>



























       
    </>
    );
  }
  
  export default Projects;
